import {emptyChatImage} from '../../constants/data'
import {Box, Typography,styled} from '@mui/material'

const Component = styled(Box)`
    background:#f8f9fa;
    padding: 30px 0;
    text-align:center;
    height:100%
`
const Container = styled(Box)`
    padding: 0 200px;
`
const Image = styled('img')({
    width: 400,
    marginTop: 100
})
const Title = styled(Box)`
   font-size:32px;
   margin:25px 0 10px 0;
   font-family: inherit;
   font-weight:300;
   color:#41525d;

`

const EmptyChat = () =>{
    return (
       <Component>
        <Container>
            <Image src={emptyChatImage} alt='image' />
            <Title>LetsChat Web</Title>
            <Typography>Send and receive messages without keeping your phone online.</Typography>
            <Typography>Use LetsChat on up to 4 linked devices and 1 phone at the same time.</Typography>
        </Container>
       </Component>
    )
}

export default EmptyChat;
